import React from "react";
import styled from "styled-components";
import Helmet from "react-helmet";

const Container = styled.div`
  padding: 20px;
`

const HomePresenter = () => (
  <>
    <Helmet>
      <title>Teamate</title>
    </Helmet>
    <Container>
      Hello world!
    </Container>
  </>
)

export default HomePresenter;
